n a data set vary from the mean.\n","\n","1. selling_price: The prices range from 29,999 to 10,000,000, with an average (mean) of 649,813.72. The standard deviation (SD) is 813,582.75, indicating a significant spread in prices.\n","\n","2. year: The cars in the dataset span from 1994 to 2020. The average year is approximately 2014.\n","\n","3. km_driven: The mileage covered by cars ranges from 1 to 2,360,457 km. The average (mean) is 69,188.66 km, with a standard deviation of 56,792.30 km.\n","\n","4. mileage: Mileage varies from 0 to 42, with an average of 19.42 and a standard deviation of 4.04.\n","\n","5. engine: Engine capacity ranges from 624 to 3,604, with an average of 1,458.71 and a standard deviation of 503.89.\n","\n","6. max_power: Maximum power output ranges from 32.8 to 400, with an average of 91.59 and a standard deviation of 35.75.\n","\n","7. seats: The number of seats ranges from 2 to 14, with an average of 5.42 and a very low standard deviation of 0.96, indicating less variability in this variable.\n","\n","8. age: The age of cars ranges from 4 to 30 years, with an average of 10.02 years. The standard deviation is 3.86, indicating variability in the age of the cars.\n","\n","These summary statistics provide a quick overview of the central tendency, spread, and distribution of the different variables in the dataset. To better visualise this descriptive statistics, we use box plots. Box plots show the five-number summary of a set of data: including the minimum and maximum score (shown by the tail end of whiskers), Quantiles (shown by the end of the box) and median(which is the line that divides the box). \n","\n","We should also note that upper and lower whiskers represent scores outside the middle 50% (i.e., the lower 25% of scores and the upper 25% of scores). This means that values outside this whiskers are considered as outliers. Outliers are data points that are significantly different from the rest of the data in the dataset i.e it indicates th